import React from 'react';

const headerStyle = {
    padding: '25px 50px',
    background: '#3085d6',
    color: 'white'
};

const Header = () => {
    return (
      <div style={headerStyle}>
          <h1>JAM</h1> 
      </div>
    );
};

export default Header;
